import { db } from '../../lib/db';

const saveStatus = async (req, res) => {
  await db.collection('test').add({
    teste: 1,
    coordinates: new admin.firestore.GeoPoint(-12.0923173, -38.9839643),
  });
  console.log(req);
  res.send({ ok: true });
};
export default saveStatus;
